import React from 'react';
import Sidebar from '../components/Sidebar/Sidebar';
import Topbar from '../components/Topbar/Topbar';
import './MainLayout.css';

const MainLayout = ({ children, activeMenu, onMenuClick, onSignOut, onAddBillClick, userName }) => {
  return (
    <div className="main-layout">
      <Sidebar activeMenu={activeMenu} onMenuClick={onMenuClick} onSignOut={onSignOut} />
      <div className="main-container">
        <Topbar onAddBillClick={onAddBillClick} userName={userName} />
        <div className="main-content">
          {children}
        </div>
      </div>
    </div>
  );
};

export default MainLayout;
